import React, { useEffect } from "react";
import { useNavigate } from "react-router";
import PostForm from "./PostForm";
import useAuth from "../hooks/useAuth";
const Dashboard = () => {
  const { auth } = useAuth();
  return (
    <>
      <section>
        <h1> Welcome {auth.name}</h1>
        <p>Dashboard</p>
      </section>
      <PostForm />
    </>
  );
};

export default Dashboard;
